import { YELLOW } from "../helpers/colors"

const Example = () => {
    const name = ['zahra', 'sara', 'maryam']
    const newName = name.map(n => (
        n+ " " + "Hello"
    ))

    return (
        <div>
            <h3 className="h3" style={{ backgroundColor: YELLOW }}>
                {newName}
            </h3>
        </div>
    )
}

export default Example
